import API from '../API';
import { useEffect, useState } from 'react';
import { Button, Typography } from '@aircall/tractor';

import AppStyling from '../AppStyling';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(AppStyling);

const CallInformation = ({ call }) => {
  const classes = useStyles();
  console.log(call);
  return (
    <>
      <div className={classes.callInformation}>
        <h2>{call.from}</h2>
        <Typography className="callDate">
          From {call.created_at.slice(0, 19).replace('T', ' ')}
        </Typography>
      </div>
      <div className={classes.callNotes}></div>
    </>
  );
};

export default CallInformation;
